description:
As we explore the actual cubic calculations of the stones used, exploring the use of small stones in the small mass (point) of the structure, and large stones in the large mass (base) of the structure, we find a 1 million stone count error in the base alone. Check out this simple rock diagram that demonstrates a multiplicative counting error of the naive.
